import React from 'react';

export const Icon = (props) =>{

		const icon = {
			bright:'../../assets/icons/bright.png',
			sheet:'../../assets/icons/sheet.png',
		}
	return(
		<div>
			<img src={require(icon.sheet)} alt="" width={props.size} height={props.size}/>
		</div>
	);
}
